import React from 'react'
import { BrowserRouter, Router } from 'react-router-dom'
import stylesheet from './Pages.module.css'
import Home from './Home/Home'

const Pages = () => {
    return (
        <BrowserRouter>
            <Router path='/home' element={Home} />
        </BrowserRouter>
    )
}

export default Pages;
